import React from 'react';
import './App.css';
import AOS from 'aos';
import 'aos/dist/aos.css';
import Header from './components/Header';
import Home from './pages/Home';


function App() {
  return (

      AOS.init({
        easing: 'ease',
		    duration: 1800,
		    once: true
      }),
    <div className="App">
      <Header/>
      <Home/>
    </div>
  );
}

export default App;
